script: |
  super -f text -I q6361.spq | sort > q6361.out

inputs:
  - name: q6361.spq
    data: |
      SELECT + col1 + col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN ( + + col2 * + - ( + col1 ) * + col1 / - col0 ) AND NULL;
  - name: tab2

outputs:
  - name: q6361.out
    data: |
